import ExpenseItem from "./ExpenseItem";
import "./ExpensesList.css";

const ExpensesList = ({ filteredExpenses }) => {
  return filteredExpenses.map((expense) => (
    <ExpenseItem key={expense.id} expense={expense} />
  ));
};

export default ExpensesList;
